import React, { Component } from 'react';

class MusicCard extends Component {
  render() {
    const { trackName, previewUrl } = this.props;
    return (
      <div>
        <h3>
          {trackName}
        </h3>
        <h3>
          {previewUrl}
        </h3>
      </div>
    );
  }
}

export default MusicCard;
